INSERT INTO actionlogrecords (id,username,actiondate,namespace,actionname,parameters,activitystreaminfo,updatedate) VALUES (640,'admin','2020-08-27 08:44:25','/do/jacms/Content','saveAndApprove','entandoaction:saveAndApprove=SubmitHypertext:it_subtitle=Image:it_img_metadata_alt=Hypertext:en_body=<p>For manufacturers of every size in every industry, it&rsquo;s no exaggeration to say that the coronavirus crisis has changed everything. Demand for products has been upended, relationships with suppliers and customers are being tested and liquidity issues have multiplied. Some manufacturers are pivoting to create essential gear to help combat the pandemic, while others are retooling in advance of future needs, and all are trying to keep their workers safe. Abhijit Bhide, managing director, Bank of America Global Banking and Markets, answers questions about this unprecedented upheaval and how businesses can respond now and in the months ahead.</p>Image:it_img_metadata_title=Image:en_img_metadata_description=Text:en_title=Manufacturers Respond to Coronavirus__multiselect_extraGroupNames=contentOnSessionMarker=NWS_newContentresourceTypeCode=Image:it_img_metadata_legend=treeNodesToOpen=homeMonolist:Link:it_links_0=Image:it_img_metadata_description=Monolist:Link:it_links_1=Image:it_img=Hypertext:en_subtitle=<p>Companies are moving quickly to stay viable and position themselves for recovery</p>Monolist:Attach:en_attaches_0=Entando_Admin_Console_Overview_4.3.3_EN.pdfdescr=Manufacturers Respond to CoronavirusImage:en_img_metadata_legend=Monolist:Link:en_links_1=mio sito 2Hypertext:it_body=Image:en_img_metadata_title=Monolist:Link:en_links_0=mio sitoImage:en_img=coronavirusImage:en_img_metadata_alt=Monolist:Attach:it_attaches_0=Text:it_title=status=','<?xml version="1.0" encoding="UTF-8" standalone="yes"?><activityStreamInfo>    <objectTitles>        <entry>            <key xsi:type="xs:string" xmlns:xs="http://www.w3.org/2001/XMLSchema" xmlns:xsi="http://www.w3.org/2001/XMLSchema