INSERT INTO actionlogrecords (id,username,actiondate,namespace,actionname,parameters,activitystreaminfo,updatedate) VALUES (704,'admin','2020-08-27 15:50:26','/do/jacms/Content','saveAndApprove','Image:en_image_metadata_title=entandoaction:saveAndApprove=SubmitHypertext:it_subtitle=Image:en_image_metadata_description=Text:en_title=Seed International TravelImage:en_image_metadata_alt=Monolist:Composite:Text:en_paragraphs_mtitle_1=Why Do I Need Travel Medical Insurance?Monolist:Composite:Text:en_paragraphs_mtitle_0=__multiselect_extraGroupNames=contentOnSessionMarker=PRD_editContent_PRD673Image:en_image=Travel_Insurance_Image_d0 (1).pngImage:it_image_metadata_legend=Monolist:Composite:Hypertext:it_paragraphs_mbody_1=Image:it_image_metadata_alt=resourceTypeCode=Monolist:Composite:Hypertext:it_paragraphs_mbody_0=Image:it_image_metadata_description=Image:it_image_metadata_title=Monolist:Composite:Hypertext:en_paragraphs_mbody_0=<p>International Travel Insurance protects you in the event of an illness or injury when traveling outside of your country of residence. It provides key medical benefits in case of an emergency.<br />Traveling abroad is an exciting experience, but unpredictable illnesses and accidents can happen. Even worse, the resulting medical bills can be overwhelming. The level of international medical coverage provided by your domestic insurance provider can vary greatly depending on your plan, so you may have very limited coverage or no coverage at all. A travel medical insurance plan can provide the coverage you need.</p>treeNodesToOpen=homeImage:en_image_metadata_legend=Hypertext:en_subtitle=<p>Seed International travel provides comprehensive cover for expats who are living or travelling outside of their home country for an extended period of time.</p>descr=Seed International TravelMonolist:Composite:Hypertext:en_paragraphs_mbody_1=<p>Depending on where you travel, you may encounter language and currency barriers that prevent you from accessing high-quality medical care.<br />Traveling unprotected can leave you vulnerable to paying high out-of-pocket medical expenses, and navigating a foreign health care system without the assistance you need.<br />However, with a travel medical insurance plan, you can worry less and experience more knowing you have medical coverage and a trusted health advisor who can support you in your time of need.</p>Monolist:Composite:Text:it_paragraphs_mtitle_0=Image:it_image=Text:it_title=Monolist:Composite:Text:it_paragraphs_mtitle_1=status=DRAFT','<?xml version="1.0" encoding="UTF-8" standalone="yes"?><activityStreamInfo>    <objectTitles>        <entry>            <key xsi:type="xs:string" xmlns:xs="http://www.w3.org/2001/XMLSchema" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance">en</key>            <value xsi:type="xs:string" xmlns:xs="http://www.w3.org/2001/XMLSchema" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance">Seed International Travel</value>        </entry>    </objectTitles>    <groups>        <group>administrators</group>        <group>administrators</group>    </groups>    <actionType>12</actionType>    <linkNamespace>/do/jacms/Content</linkNamespace>    <linkActionName>edit</linkActionName>    <linkParameters>        <entry>            <key xsi:type="xs:string" xmlns:xs="http://www.w3.org/2001/XMLSchema" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance">contentId</key>            <value xsi:type="xs:string" xmlns:xs="http://www.w3.org/2001/XMLSchema" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance">PRD673</value>        </entry>    </linkParameters>    <linkAuthPermission>editContents</linkAuthPermission>    <linkAuthGroup>administrators</linkAuthGroup></activityStreamInfo>','2020-08-27 15:50:26');
