medical insurance plan can provide the coverage you need.</p>treeNodesToOpen=homeMonolist:Composite:Image:en_paragraphs_mimage_1_metadata_description=Image:en_image_metadata_legend=Monolist:Link:it_links_0=Hypertext:en_subtitle=<p>Seed International travel provides comprehensive cover for expats who are living or travelling outside of their home country for an extended period of time.</p>Monolist:Attach:en_attaches_0=Entando_Admin_Console_Overview_4.3.3_EN.pdfdescr=Seed International TravelMonolist:Composite:Hypertext:en_paragraphs_mbody_1=<p>Depending on where you travel, you may encounter language and currency barriers that prevent you from accessing high-quality medical care.<br />Traveling unprotected can leave you vulnerable to paying high out-of-pocket medical expenses, and navigating a foreign health care system without the assistance you need.<br />However, with a travel medical insurance plan, you can worry less and experience more knowing you have medical coverage and a trusted health advisor who can support you in your time of need.</p>Monolist:Link:en_links_0=Discover moreMonolist:Composite:Image:it_paragraphs_mimage_1_metadata_title=Monolist:Composite:Text:it_paragraphs_mtitle_0=Monolist:Attach:it_attaches_0=Image:it_image=Text:it_title=Monolist:Composite:Text:it_paragraphs_mtitle_1=status=DRAFT','<?xml version="1.0" encoding="UTF-8" standalone="yes"?><activityStreamInfo>    <objectTitles>        <entry>            <key xsi:type="xs:string" xmlns:xs="http://www.w3.org/2001/XMLSchema" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance">en</key>            <value xsi:type="xs:string" xmlns:xs="http://www.w3.org/2001/XMLSchema" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance">Seed International Travel</value>        </entry>    </objectTitles>    <groups>        <group>administrators</group>        <group>administrators</group>    </groups>    <actionType>12</actionType>    <linkNamespace>/do/jacms/Content</linkNamespace>    <linkActionName>edit</li